import React from 'react';
import '../../Media.css';

class Social extends React.Component{

    render(){
        return  <div className="socialmedia">
                    <h5>Facebook</h5>
                    <h5>Twitter</h5>
                    <h5>Instgram</h5>
                    <h5>Pinterest</h5>
                    <h5>Flickr</h5>
                </div>  
    }
}

export default Social;
